INSERT INTO `policy` VALUES ('project-owner-policy','Project Ownership Policy','<p>SWAMP users agree to this policy when accepting the Project Owner privilege, which enables users to create and own Projects. This policy is a supplement to the SWAMP Acceptable Use Policy that all SWAMP users agree to.</p> <h2>SWAMP Project Owner Policy</h2> <p>As a SWAMP Project Owner, you are responsible for your SWAMP Project(s) and the activities that occur within your SWAMP Project(s). Your responsibilities include:</p> <ul> <li>Maintaining an accurate Description of your Project in your SWAMP Project Profile.</li> <li>Inviting only known colleagues to be Project Members and promptly removing Project Members who are no longer active colleagues.</li> <li>Submitting Run Requests consistent with the goals of your Project as stated in your Project Description.</li> <li>Periodically reviewing Run Requests submitted by Project Members for appropriate use of SWAMP resources.</li>  <li>Reporting any violations of the SWAMP Acceptable Use Policy by Project Members to the SWAMP Help Desk.</li>  </ul>',NULL,'2014-10-31 15:07:17','root@tardis','2015-07-10 22:06:27'),('support-consent','User Support Consent','In submitting a support request, you authorize SWAMP support staff to access data associated with your SWAMP account only to the extent required to resolve your support request.This authorization is valid only for the duration of your support request and will terminate upon resolution of your support request.',NULL,'2015-04-24 17:27:13','root@tardis','2015-07-10 22:06:27');
