INSERT INTO `tool` VALUES ('0f668fb0-4421-11e4-a4f3-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','Pylint','Pylint is a tool that checks for errors in Python code, tries to enforce a coding standard, and looks for bad code smells. <a href=\"http://www.pylint.org/\">http://www.pylint.org/</a>','PUBLIC',0,NULL,NULL,'2014-09-29 19:57:20','root@tardis','2015-07-10 22:01:04'),('163d56a7-156e-11e3-a239-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','Findbugs','FindBugs is a program to find bugs in Java code. It looks for \"bug patterns\" - code instances that are likely to be errors. <a href=\"http://findbugs.sourceforge.net/\">http://findbugs.sourceforge.net/</a>','PUBLIC',1,NULL,NULL,'2014-02-01 23:37:56','root@tardis','2015-07-10 22:01:04'),('163e5d8c-156e-11e3-a239-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','cppcheck','Cppcheck is a static analysis tool for C/C++ code. Unlike C/C++ compilers and many other analysis tools, it does not detect syntax errors in the code. Cppcheck primarily detects the types of bugs that the compilers normally do not detect. The goal is to detect only real errors in the code (i.e. have zero false positives). <a href=\"http://cppcheck.sourceforge.net/\">http://cppcheck.sourceforge.net/</a>','PUBLIC',0,NULL,NULL,'2014-02-01 23:37:56','root@tardis','2015-07-10 22:01:04'),('163f2b01-156e-11e3-a239-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','PMD','PMD is a Java source code analyzer. It finds common programming flaws like unused variables, empty catch blocks, and unnecessary object creation. <a href=\"http://pmd.sourceforge.net/\">http://pmd.sourceforge.net/</a>','PUBLIC',0,NULL,NULL,'2014-02-01 23:37:56','root@tardis','2015-07-10 22:01:04'),('56872C2E-1D78-4DB0-B976-83ACF5424C52','80835e30-d527-11e2-8b8b-0800200c9a66','error-prone','Error-prone augments the compiler\'s type analysis to catch Java mistakes before they end up as bugs in production. <a href=\"http://errorprone.info/\">http://errorprone.info/</a>','PUBLIC',0,NULL,NULL,'2014-05-15 06:22:40','root@tardis','2015-07-10 22:01:04'),('63695cd8-a73e-11e4-a335-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','Flake8','Flake8 is a Python tool that glues together pep8, pyflakes, mccabe, and third-party plugins to check the style and quality of Python code. <a href=\"https://gitlab.com/pycqa/flake8\">https://gitlab.com/pycqa/flake8</a>','PUBLIC',0,NULL,NULL,'2015-01-30 18:23:23','root@tardis','2015-07-10 22:01:04'),('7A08B82D-3A3B-45CA-8644-105088741AF6','80835e30-d527-11e2-8b8b-0800200c9a66','GCC','The GNU Compiler Collection includes front ends for C & C++. GCC was originally written as the compiler for the GNU operating system. <a href=\"https://gcc.gnu.org/\">https://gcc.gnu.org/</a>','PUBLIC',0,NULL,NULL,'2014-02-01 23:37:56','root@tardis','2015-07-10 22:01:04'),('7fbfa454-8f9f-11e4-829b-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','Bandit','Bandit provides a framework for performing security analysis of Python source code. <a href=\"https://wiki.openstack.org/wiki/Security/Projects/Bandit\">https://wiki.openstack.org/wiki/Security/Projects/Bandit</a>','PUBLIC',0,NULL,NULL,'2014-12-29 21:54:29','root@tardis','2015-07-10 22:01:04'),('9289b560-8f8b-11e4-829b-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','Android lint','Android Lint is a static code analysis tool that checks Android project source files for potential bugs and optimization improvements for correctness, security, performance, usability, accessibility, and internationalization. <a href=\"http://tools.android.com/tips/lint\">http://tools.android.com/tips/lint</a>','PUBLIC',0,NULL,NULL,'2014-12-29 21:54:29','root@tardis','2015-07-10 22:01:04'),('992A48A5-62EC-4EE9-8429-45BB94275A41','80835e30-d527-11e2-8b8b-0800200c9a66','checkstyle','Checkstyle is a development tool to help programmers write Java code that adheres to a coding standard. <a href=\"http://checkstyle.sourceforge.net/\">http://checkstyle.sourceforge.net/</a>','PUBLIC',0,NULL,NULL,'2014-05-15 06:22:40','root@tardis','2015-07-10 22:01:04'),('f212557c-3050-11e3-9a3e-001a4a81450b','80835e30-d527-11e2-8b8b-0800200c9a66','Clang Static Analyzer','The Clang Static Analyzer is a source code analysis tool that finds bugs in C & C++. <a href=\"http://clang-analyzer.llvm.org/\">http://clang-analyzer.llvm.org/</a>','public',0,NULL,NULL,'2014-02-01 23:37:56','root@tardis','2015-07-10 22:01:04');
